import React, { useEffect, useState } from "react";
import logo from "./logo.svg";
import "./App.css";
import SearchPanel from "./components/SearchPanel";
import { Container, Grid } from "@mui/material";

function App() {
  const [content, setContent] = useState("");
  const searchContent = (content: string) => {
    const apiUrl = `https://api.example.com/search?query=${encodeURIComponent(
      content
    )}`;
    console.log("Searching " + content);
  };

  useEffect(() => {
    fetch("api-gateway-api.com").then().catch();
  }, []);

  return (
    <Container maxWidth="md">
      <Grid container spacing={2}>
        <Grid
          item
          xs={12}
          display={"flex"}
          justifyContent={"center"}
          alignItems={"center"}
        >
          <SearchPanel searchContent={searchContent} />
        </Grid>
        <Grid item xs={6}>
          Hello
        </Grid>
        <Grid item xs={6}>
          World
        </Grid>
      </Grid>
    </Container>
  );
}

export default App;
